# In[11]:


def average(numbers):
   print('debug1:', numbers)
   if len(numbers) > 0:
         print('debug2:', sum(numbers))
         return sum(numbers) / len(numbers)


# In[12]:


0.1 == average(3*[0.1])


# ##5. Call functions with test cases

# ![image.png](data:image/png;base64,)

# Try the "edge cases": smallest, largest

# In[13]:


def fib(n):
    if n == 0 or n == 1:
        return n
    else:
        return fib(n - 1) + fib(n - 2)


# In[15]:


# test edge 0
obs = fib(0)
assert obs == 3

# test edge 1
obs = fib(1)
assert obs == 1

# test internal point
obs = fib(6)
assert obs == 8


